import ReactDOM from 'react-dom';
import './css/11.css';
import './css/22.css';
import  "./img/ship.png"

import  Header  from "./header/Header" 
import   List  from "./list/List"
// import  Userlist  from "./userlist/Userlist" 
  
ReactDOM.render(
  <div>
    {/* 帆船部分 */}
    <Header/>
    {/* tab切换部分 */}
    <List/>
  </div>,
    document.getElementById('root')
);
